IF NOT EXISTS (SELECT * FROM sys.databases WHERE name = 'SyntraReizenDB')
BEGIN
    CREATE DATABASE SyntraReizenDB
END

GO

Use SyntraReizenDB

GO

CREATE TABLE dbo.Countries (
  ISO CHAR(2) NOT NULL PRIMARY KEY,
  CountryDesc VARCHAR(100) NOT NULL
);

CREATE TABLE dbo.PostalCode (
  Id INT NOT NULL PRIMARY KEY,
  Countries_ISO CHAR(2) NOT NULL FOREIGN KEY REFERENCES dbo.Countries (ISO),
  ZipCode VARCHAR(50) NOT NULL,
  City VARCHAR(45) NOT NULL
);

CREATE INDEX fk_PostalCode_Countries1_idx ON dbo.PostalCode (Countries_ISO ASC);


CREATE TABLE dbo.Addresses (
  Id INT NOT NULL PRIMARY KEY,
  Street VARCHAR(45) NOT NULL,
  Number VARCHAR(45) NOT NULL,
  PostalBox VARCHAR(45) NULL,
  PostalCode_Addition_NL CHAR(2) NULL,
  PostalCode_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.PostalCode (Id)
);

CREATE INDEX fk_Addresses_PostalCode1_idx ON dbo.Addresses (PostalCode_Id ASC);



CREATE TABLE dbo.Customers (
  Id INT NOT NULL PRIMARY KEY,
  FirstName VARCHAR(45) NOT NULL,
  MidName VARCHAR(45) NOT NULL,
  LastName VARCHAR(45) NOT NULL,
  Email VARCHAR(45) NOT NULL,
  Phone VARCHAR(45) NOT NULL,
  DateOfBirth VARCHAR(45) NOT NULL,
  IdCardNumber VARCHAR(45) NOT NULL,
  PassportNumber VARCHAR(45) NOT NULL,
  Addresses_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id)
);

CREATE INDEX fk_Customers_Addresses_idx ON dbo.Customers (Addresses_Id ASC);

CREATE TABLE dbo.Languages (
  ISO CHAR(3) NOT NULL PRIMARY KEY,
  Name VARCHAR(100) NOT NULL
);

CREATE TABLE dbo.LanguagesCustomersCombo (
  Id INT NOT NULL PRIMARY KEY,
  Proficiency CHAR(2) NOT NULL,
  Languages_ISO CHAR(3) NOT NULL FOREIGN KEY REFERENCES dbo.Languages (ISO),
  Customers_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Customers (Id)
);

CREATE INDEX fk_LanguagesCustomersCombo_Languages1_idx ON dbo.LanguagesCustomersCombo (Languages_ISO ASC);
CREATE INDEX fk_LanguagesCustomersCombo_Customers1_idx ON dbo.LanguagesCustomersCombo (Customers_Id ASC);

CREATE TABLE dbo.CompanyRoles (
  Id INT NOT NULL PRIMARY KEY,
  RoleDescription VARCHAR(45) NOT NULL
);

CREATE TABLE dbo.Employees (
  Id INT NOT NULL PRIMARY KEY,
  FirstName VARCHAR(45) NOT NULL,
  MidName VARCHAR(45) NOT NULL,
  LastName VARCHAR(45) NOT NULL,
  CompanyEmail VARCHAR(45) NOT NULL,
  CompanyPhone VARCHAR(45) NOT NULL,
  DateOfBirth VARCHAR(45) NOT NULL,
  PersEmail VARCHAR(45) NOT NULL,
  PersPhone VARCHAR(45) NOT NULL,
  IdCardNumber VARCHAR(45) NOT NULL,
  PassportNumber VARCHAR(45) NOT NULL,
  ExtraInfo VARCHAR(500) NULL,
  CompanyAddress INT NOT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id),
  PersAddress INT NOT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id),
  LangPreference CHAR(3) NOT NULL FOREIGN KEY REFERENCES dbo.Languages (ISO),
  LangKnowledge INT NOT NULL FOREIGN KEY REFERENCES dbo.LanguagesCustomersCombo (Id),
  CompanyRoles_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.CompanyRoles (Id)
);

CREATE INDEX fk_Employees_Addresses1_idx ON dbo.Employees (CompanyAddress ASC);
CREATE INDEX fk_Employees_Addresses2_idx ON dbo.Employees (PersAddress ASC);
CREATE INDEX fk_Employees_Languages1_idx ON dbo.Employees (LangPreference ASC);
CREATE INDEX fk_Employees_LanguagesCustomersCombo1_idx ON dbo.Employees (LangKnowledge ASC);
CREATE INDEX fk_Employees_CompanyRoles1_idx ON dbo.Employees (CompanyRoles_Id ASC);


CREATE TABLE dbo.Holidays (
  Id INT NOT NULL PRIMARY KEY,
  Name VARCHAR(45) NOT NULL,
  MaxParticipants INT NOT NULL,
  Price FLOAT NOT NULL,
  PriceDate DATETIME2(0) NOT NULL,
  Deposit FLOAT NOT NULL,
  DepositDate DATETIME2(0) NOT NULL,
  HolidayDescription VARCHAR(45) NOT NULL,
  Countries_ISO_From CHAR(2) NOT NULL FOREIGN KEY REFERENCES dbo.Countries (ISO),
  Countries_ISO_To CHAR(2) NOT NULL FOREIGN KEY REFERENCES dbo.Countries (ISO),
  Guide INT NOT NULL FOREIGN KEY REFERENCES dbo.Employees (Id)
);

CREATE INDEX fk_Trip_Countries1_idx ON dbo.Holidays (Countries_ISO_From ASC);
CREATE INDEX fk_Trip_Countries2_idx ON dbo.Holidays (Countries_ISO_To ASC);
CREATE INDEX fk_Holidays_Employees1_idx ON dbo.Holidays (Guide ASC);


CREATE TABLE dbo.Booking (
  Id INT NOT NULL PRIMARY KEY,
  AmountPaid FLOAT NOT NULL,
  PaidDate DATETIME2(0) NOT NULL,
  AnnullationInsurance SMALLINT NOT NULL,
  ExtraInfo VARCHAR(2000) NULL,
  Trip_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Holidays (Id)
);

CREATE INDEX fk_Booking_Trip1_idx ON dbo.Booking (Trip_Id ASC);

CREATE TABLE dbo.CustomersBookingCombo (
  Id INT NOT NULL PRIMARY KEY,
  Customers_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Customers (Id),
  Booking_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Booking (Id)
);

CREATE INDEX fk_CustomersBookingCombo_Booking1_idx ON dbo.CustomersBookingCombo (Booking_Id ASC);
CREATE INDEX fk_CustomersBookingCombo_Customers1_idx ON dbo.CustomersBookingCombo (Customers_Id ASC);

CREATE TABLE dbo.AccomType (
  Id INT NOT NULL PRIMARY KEY,
  Name VARCHAR(45) NOT NULL);

CREATE TABLE dbo.Accommodation (
  Id INT NOT NULL PRIMARY KEY,
  Name VARCHAR(45) NOT NULL,
  Email VARCHAR(45) NOT NULL,
  Phone VARCHAR(45) NOT NULL,
  Website VARCHAR(45) NOT NULL,
  WebsiteParam VARCHAR(45) NOT NULL,
  AccomAddress INT NOT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id),
  AccomType_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.AccomType (Id)
);

CREATE INDEX fk_Accommodation_Addresses1_idx ON dbo.Accommodation (AccomAddress ASC);
CREATE INDEX fk_Accommodation_AccomType1_idx ON dbo.Accommodation (AccomType_Id ASC);

CREATE TABLE dbo.TransportType (
  Id INT NOT NULL PRIMARY KEY,
  TransportDescr VARCHAR(45) NOT NULL);

CREATE TABLE dbo.Airline (
  IATA_Airline CHAR(2) NOT NULL PRIMARY KEY,
  AirlineDescr VARCHAR(45) NOT NULL
);

CREATE TABLE dbo.TransportCompany (
  Id INT NOT NULL PRIMARY KEY,
  Name VARCHAR(45) NOT NULL,
  Email VARCHAR(45) NOT NULL,
  Website VARCHAR(45) NOT NULL,
  WebsiteParam VARCHAR(45) NOT NULL,
  Phone VARCHAR(45) NOT NULL,
  Addresses_Id INT FOREIGN KEY REFERENCES dbo.Addresses (Id),
  Airline_IATA_Airline CHAR(2) FOREIGN KEY REFERENCES dbo.Airline (IATA_Airline)
);

CREATE INDEX fk_TransportCompany_Addresses1_idx ON dbo.TransportCompany (Addresses_Id ASC);
CREATE INDEX fk_TransportCompany_Airline1_idx ON dbo.TransportCompany (Airline_IATA_Airline ASC);

CREATE TABLE dbo.Trip (
  Id INT NOT NULL PRIMARY KEY,
  CityFrom INT NOT NULL FOREIGN KEY REFERENCES dbo.PostalCode (Id),
  CityTo INT NOT NULL FOREIGN KEY REFERENCES dbo.PostalCode (Id),
  Holidays_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Holidays (Id),
  AccomBooking_BookingNumber INT NULL,
  TransportBooking_BookingNumber VARCHAR(10) NULL
);

CREATE INDEX fk_Trip_PostalCode1_idx ON dbo.Trip (CityFrom ASC);
CREATE INDEX fk_Trip_PostalCode2_idx ON dbo.Trip (CityTo ASC);
CREATE INDEX fk_Trip_Holidays1_idx ON dbo.Trip (Holidays_Id ASC);

CREATE TABLE dbo.TransportBooking (
  BookingNumber VARCHAR(10) NOT NULL PRIMARY KEY,
  ExternalBookingId VARCHAR(45) NOT NULL,
  TransportType_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.TransportType (Id),
  TransportCompany_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.TransportCompany (Id)
);

CREATE INDEX fk_TransportBooking_TransportType1_idx ON dbo.TransportBooking (TransportType_Id ASC);
CREATE INDEX fk_TransportBooking_TransportCompany1_idx ON dbo.TransportBooking (TransportCompany_Id ASC);

ALTER TABLE dbo.Trip ADD FOREIGN KEY (TransportBooking_BookingNumber) REFERENCES dbo.TransportBooking (BookingNumber);
CREATE INDEX fk_Trip_TransportBooking1_idx ON dbo.Trip (TransportBooking_BookingNumber ASC);

CREATE TABLE dbo.AccomBooking (
  BookingNumber INT NOT NULL PRIMARY KEY,
  ExternalBookingId VARCHAR(45) NOT NULL,
  DateFrom DATETIME2(0) NOT NULL,
  DateTo DATETIME2(0) NOT NULL,
  Accommodation_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Accommodation (Id),
);

CREATE INDEX fk_AccomBooking_Accommodation1_idx ON dbo.AccomBooking (Accommodation_Id ASC);

ALTER TABLE dbo.Trip ADD FOREIGN KEY (AccomBooking_BookingNumber) REFERENCES dbo.AccomBooking (BookingNumber);
CREATE INDEX fk_Trip_AccomBooking1_idx ON dbo.Trip (AccomBooking_BookingNumber ASC);

CREATE TABLE dbo.ReisTripCombo (
  Id INT NOT NULL PRIMARY KEY,
  Trip_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Trip (Id),
  Holidays_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.Holidays (Id)
);

CREATE INDEX fk_ReisTripCombo_Trip1_idx ON dbo.ReisTripCombo (Trip_Id ASC);
CREATE INDEX fk_ReisTripCombo_Holidays1_idx ON dbo.ReisTripCombo (Holidays_Id ASC);

CREATE TABLE dbo.Airports (
  IATA_Code CHAR(3) NOT NULL PRIMARY KEY,
  AirportName VARCHAR(45) NOT NULL,
  CountryCode CHAR(2) NOT NULL FOREIGN KEY REFERENCES dbo.Countries (ISO)
);

CREATE TABLE dbo.TransportTrip (
  Id INT NOT NULL PRIMARY KEY,
  FlightNumber VARCHAR(45) NULL,
  RailNumber VARCHAR(45) NULL,
  ArrivalTime DATETIME2(0) NOT NULL,
  DepartureTime DATETIME2(0) NOT NULL,
  AirportFrom CHAR(3) NULL FOREIGN KEY REFERENCES dbo.Airports (IATA_Code),
  AirportTo CHAR(3) NULL FOREIGN KEY REFERENCES dbo.Airports (IATA_Code),
  AddressFrom INT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id),
  AddressTo INT NULL FOREIGN KEY REFERENCES dbo.Addresses (Id)
);

CREATE INDEX fk_TransportTrip_Airports1_idx ON dbo.TransportTrip (AirportFrom ASC);
CREATE INDEX fk_TransportTrip_Airports2_idx ON dbo.TransportTrip (AirportTo ASC);
CREATE INDEX fk_TransportTrip_Addresses1_idx ON dbo.TransportTrip (AddressFrom ASC);
CREATE INDEX fk_TransportTrip_Addresses2_idx ON dbo.TransportTrip (AddressTo ASC);

CREATE TABLE dbo.TransportTripTransportBookingCombo (
  Id INT NOT NULL PRIMARY KEY,
  TransportTrip_Id INT NOT NULL FOREIGN KEY REFERENCES dbo.TransportTrip (Id),
  TransportBooking_BookingNumber VARCHAR(10) NOT NULL FOREIGN KEY REFERENCES dbo.TransportBooking (BookingNumber)
);

CREATE INDEX fk_TransportTripTransportBookingCombo_TransportTrip1_idx ON dbo.TransportTripTransportBookingCombo (TransportTrip_Id ASC);
CREATE INDEX fk_TransportTripTransportBookingCombo_TransportBooking1_idx ON dbo.TransportTripTransportBookingCombo (TransportBooking_BookingNumber ASC);























